    false,nt"url": null,nt"notes": "NCEI Accession 0115590 includes discrete
    sample and profile data collected from THOMAS G. THOMPSON in the North Pacific Ocean
    from 2004-04-24 to 2004-06-01. These data include CHLOROFLUOROCARBON-11 (CFC-11),
    CHLOROFLUOROCARBON-113 (CFC-113), CHLOROFLUOROCARBON-12 (CFC-12), DISSOLVED INORGANIC
    CARBON (DIC), DISSOLVED OXYGEN, HYDROSTATIC PRESSURE, NITRATE, NITRITE, Potential
    temperature (theta), SALINITY, TOTAL ALKALINITY (TA), WATER TEMPERATURE, phosphate
    and silicate. The instruments used to collect these data include CTD and bottle.nnThese
